import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./components/App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    {/* <App /> */}
    <Test />
  </React.StrictMode>
);

function Test() {
  return (
    <div>
      <Month />
    </div>
  );
}

function Month() {
  return (
    <div>
      {Array.from({ length: 6 }).map((i) => (
        <Week />
      ))}
    </div>
  );
}

function Week() {
  return (
    <div className="week">
      <Day />
    </div>
  );
}

function Day() {
  return <div className="day">Day!</div>;
}
